export default function SportCard({ src, bookName, author }) {
  return (
    <div className="card-item">
      <img src={src} alt="Unbroken" width="200" height="200" />
      <div>
        <span>Book name</span>
        <span>{bookName}</span>
      </div>
      <div>
        <span>Author</span>
        <span>{author}</span>
      </div>
    </div>
  );
}
